			shellPath = /bin/sh;
			shellScript = "# Sets the target folders and the final framework product.\nFMK_NAME=${PROJECT_NAME}\n\n# Install dir will be the final output to the framework.\n# The following line create it in the root folder of the current project.\nINSTALL_DIR=${SRCROOT}/../../../../_release/iOS/ZF_impl\n\n# Working dir will be deleted after the framework creation.\nWRK_DIR=${SRCROOT}/../../../../_tmp/build/iOS/${FMK_NAME}\n\n# whether a Cocoapods project, 0 or 1\nCOCOAPODS_PROJECT=0\n\n# whether incremental build, 0 or 1\nINCREMENTAL_BUILD=1\n\n# copy header if not empty\nHEADER_SRC_PATH=../../../src\nHEADER_DST_PATH=${INSTALL_DIR}/include\n\n# copy res if not empty\nRES_SRC_PATH=../../../res\nRES_DST_PATH=${INSTALL_DIR}/res\n\n# whether to open result folder automatically, 0 or 1\nAUTO_OPEN_INSTALL_DIR=0\n\n# ============================================================\n# no need to change these\n# ============================================================\n# build paths\nDEVICE_DIR=${WRK_DIR}/Release-iphoneos\nSIMULATOR_DIR=${WRK_DIR}/Release-iphonesimulator\n\n# -configuration ${CONFIGURATION}\n# Clean and Building both architectures.\nif [ ${COCOAPODS_PROJECT} = \"1\" ]; then\nif [ ${INCREMENTAL_BUILD} = \"1\" ]; then\nxcodebuild -workspace \"${FMK_NAME}.xcworkspace\" -scheme \"${FMK_NAME}\" -configuration \"Release\" -sdk iphoneos SYMROOT=${WRK_DIR}\nxcodebuild -workspace \"${FMK_NAME}.xcworkspace\" -scheme \"${FMK_NAME}\" -configuration \"Release\" -sdk iphonesimulator SYMROOT=${WRK_DIR}\nelse\nxcodebuild -workspace \"${FMK_NAME}.xcworkspace\" -scheme \"${FMK_NAME}\" -configuration \"Release\" -target -sdk iphoneos clean build SYMROOT=${WRK_DIR}\nxcodebuild -workspace \"${FMK_NAME}.xcworkspace\" -scheme \"${FMK_NAME}\" -configuration \"Release\" -target -sdk iphonesimulator clean build SYMROOT=${WRK_DIR}\nfi\nelse\nif [ ${INCREMENTAL_BUILD} = \"1\" ]; then\nxcodebuild -configuration \"Release\" -target \"${FMK_NAME}\" -sdk iphoneos SYMROOT=${WRK_DIR}\nxcodebuild -configuration \"Release\" -target \"${FMK_NAME}\" -sdk iphonesimulator SYMROOT=${WRK_DIR}\nelse\nxcodebuild -configuration \"Release\" -target \"${FMK_NAME}\" -sdk iphoneos clean build SYMROOT=${WRK_DIR}\nxcodebuild -configuration \"Release\" -target \"${FMK_NAME}\" -sdk iphonesimulator clean build SYMROOT=${WRK_DIR}\nfi\nfi\n\n# Cleaning the oldest.\nif [ -d \"${INSTALL_DIR}\" ]; then\nrm -rf \"${INSTALL_DIR}\" >/dev/null 2>&1\nfi\n\nmkdir -p \"${INSTALL_DIR}/lib\" >/dev/null 2>&1\n\n# Uses the Lipo Tool to merge both binary files (i386 + armv6/armv7) into one Universal final product.\nlipo -create \"${DEVICE_DIR}/lib${FMK_NAME}.a\" \"${SIMULATOR_DIR}/lib${FMK_NAME}.a\" -output \"${INSTALL_DIR}/lib/lib${FMK_NAME}.a\"\n\n# remove build dir\nif [ ${INCREMENTAL_BUILD} != \"1\" ]; then\nif [ -d \"${WRK_DIR}\" ]; then\nrm -rf \"${WRK_DIR}\" >/dev/null 2>&1\nfi\nfi\n\n# copy headers\nif [[ ${HEADER_SRC_PATH} != \"\" && ${HEADER_DST_PATH} != \"\" ]]; then\nif [ -d \"${HEADER_DST_PATH}\" ]; then\nrm -rf \"${HEADER_DST_PATH}\" >/dev/null 2>&1\nfi\ncp -rf ${HEADER_SRC_PATH}/. ${HEADER_DST_PATH}/ >/dev/null 2>&1\nfind ${HEADER_DST_PATH} -type f -name \"*.c\" | xargs rm >/dev/null 2>&1\nfind ${HEADER_DST_PATH} -type f -name \"*.cpp\" | xargs rm >/dev/null 2>&1\nfind ${HEADER_DST_PATH} -type f -name \"*.m\" | xargs rm >/dev/null 2>&1\nfind ${HEADER_DST_PATH} -type f -name \"*.mm\" | xargs rm >/dev/null 2>&1\nfind ${HEADER_DST_PATH} -type f -name \"*Private*\" | xargs rm >/dev/null 2>&1\n\nfind ${HEADER_DST_PATH} -depth -type d -empty -exec rm -rf {} ';' >/dev/null 2>&1\nfi\n\n# copy res\nif [[ ${RES_SRC_PATH} != \"\" && ${RES_DST_PATH} != \"\" ]]; then\nif [ -d \"${RES_DST_PATH}\" ]; then\nrm -rf \"${RES_DST_PATH}\" >/dev/null 2>&1\nfi\ncp -rf ${RES_SRC_PATH}/. ${RES_DST_PATH}/ >/dev/null 2>&1\nfi\n\nif [ ${AUTO_OPEN_INSTALL_DIR} = \"1\" ]; then\nopen \"${INSTALL_DIR}\"\nfi\n";
